,p_script_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'create or replace package eba_util_farest_explorer as  ',
'    procedure ingest_json_describe(  ',
'        p_application_id in number,  ',
'        p_module_static_id in varchar2  ',
'    );  ',
